import React from "react";
import { Typography, Box, AppBar, Toolbar, Button, IconButton, Avatar, Stack } from "@mui/material";
import { Link } from "react-router-dom";
import Transaction from "../components/Transaction";

const Content = () => {
  return (
    <div>
      <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar variant="dense">
        <Button variant="contained" color="inherit" size="small">Account Name</Button>
          <Typography variant="body1" component="div" align="right" sx={{ flexGrow: 1 }}>
            Address
          </Typography>
        </Toolbar>
      </AppBar>
    </Box>
    <Stack
      spacing={2}
      direction="column"
      justifyContent="center"
    >
      <Button>Token List</Button>
      <Avatar></Avatar>
      <Typography>TOKEN NAME</Typography>
      <Stack direction="row">
        <Typography>Token Balance</Typography>
        <Typography>Token Symbol</Typography>
      </Stack>
      <Button>Transfer</Button>
    </Stack>
      <Typography>My account</Typography>
      <Transaction />
    </div>
  );
};

export default Content;
